package meowww;

import java.util.Scanner;

public class zad111 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
Scanner sc = new Scanner (System.in);
int s = sc.nextInt();
int e = sc.nextInt();


for (int i = s ; i <= e; i++) {
	if (i%1000==111)System.out.println(i);
	else for (int j =i/10; j>=100; j=j/10)
	{if (j%1000==111)System.out.println(i);}
}

	

	}

}
